import React from 'react'

export default function Dropdown() {

    const dropdown = event => {
        alert("I was clicked");
    }


  return (
    <>
    <button onClick={this.dropdown}>Click on me</button>
    <div class="dropdown">
        <button onclick={this.dropdown} class="dropbtn">Dropdown</button>
        <div id="myDropdown" class="dropdown-content">
            <a href="#home">Home</a>
            <a href="#about">About</a>
            <a href="#contact">Contact</a>
        </div>
    </div>
    </>
  )
}
